import React from "react";
import { Tabs, Tab } from "@material-ui/core";
export default function NavBar() {
	return (
		<div>
			<Tabs
				value={value}
				onChange={handleChange}
				aria-label="simple tabs example"
			>
				<Tab label="Item One" />
				<Tab label="Item Two" />
				<Tab label="Item Three" />
			</Tabs>
		</div>
	);
}
